Phaserfroot.PluginManager.register(
  "girl_behaviour_gfbjs",
  class girl_behaviour_gfbjs extends Phaserfroot.Component {
    constructor( target, instanceProperties ) {
      super( {
        name: "girl_behaviour_gfbjs",
        owner: target,
      } );
      this.instanceProperties = instanceProperties;
      this.scene = target.scene;
      this.game = target.scene.game;

      this.owner.once( "levelSwitch", this.destroy, this );

      // Attach custom event listeners.
      this.scene.getKey( 39 ).on( "down", this.onKeyInput39, this );
      this.scene.getKey( 39 ).on( "up", this.onKeyInput392, this );
      this.scene.getKey( 38 ).on( "down", this.onKeyInput38, this );
      this.scene.getKey( 37 ).on( "down", this.onKeyInput37, this );
      this.scene.getKey( 37 ).on( "up", this.onKeyInput372, this );
      this.owner.on( this.owner.EVENTS.LEVEL_START, this.onLevelStart2, this );
      this.owner.on( this.owner.EVENTS.COLLIDE, this.onTouchInstance2, this );


      // Initialize properties from parameters.
      this.toucher = ( typeof instanceProperties[ "toucher" ] !== "undefined" ) ? this.scene.getChildById( instanceProperties[ "toucher" ], true ) : null;
      this.Sound = instanceProperties[ "Sound" ];


      // Boot phase.
      this.camera = this.scene.cameras.main;


    }

    // BUILT-IN METHODS

    preUpdate () {

    }

    update () {
      this.EVENTS_UPDATE();

    }

    postUpdate () {

    }

    destroy () {
      this.owner.off( "levelSwitch", this.destroy, this );

      // Detach custom event listeners.
      this.scene.getKey( 39 ).off( "down", this.onKeyInput39, this );
      this.scene.getKey( 39 ).off( "up", this.onKeyInput392, this );
      this.scene.getKey( 38 ).off( "down", this.onKeyInput38, this );
      this.scene.getKey( 37 ).off( "down", this.onKeyInput37, this );
      this.scene.getKey( 37 ).off( "up", this.onKeyInput372, this );
      this.owner.removeListener( this.owner.EVENTS.LEVEL_START, this.onLevelStart2, this );
      this.owner.off( this.owner.EVENTS.COLLIDE, this.onTouchInstance2, this );

    }

    // CUSTOM METHODS

    onKeyInput39 () {
      this.owner.scaleX = 1;
      this.owner.body.velocity.x = 200;
      this.owner.playMy( 'run' );
    }

    onKeyInput392 () {
      this.owner.body.velocity.x = 0;
      this.owner.playMy( 'idle' );
    }

    onKeyInput38 () {
      this.owner.body.velocity.y = (-300);
      this.scene.components.getByName( "SoundManager" )[ 0 ].playEffect( this.Sound );
    }

    onKeyInput37 () {
      this.owner.scaleX = -1;
      this.owner.body.velocity.x = (-200);
      this.owner.playMy( 'run' );
    }

    onKeyInput372 () {
      this.owner.body.velocity.x = 0;
      this.owner.playMy( 'idle' );
    }

    EVENTS_UPDATE () {
      // Executed every frame.
      this.camera.centerOn( this.owner.x, this.owner.y );
    }

    onLevelStart2() {
      this.owner.body.allowGravity = true;
      this.scene.physics.world.gravity.y = 300;

    }

    reportError( message ) {
      message = "(" + this.name.replace( /_[\d]+$/, "" ) + ")" + message;
      console.trace( message );
      this.game.reportError( message, message, "SCRIPT ERROR" );
    }

    errorCheckNotNull( input, backup, message ) {
      if( !input ) {
        this.reportError( message );
        return backup;
      }
      return input;
    }

    errorCheckNotNull2( input, backup, message ) {
      if( !input ) {
        this.reportError( message );
        return backup;
      }
      return input;
    }

    onTouchInstance2 ( instance ) {
      if ( !instance ) {
        return;
      }
      if ( instance instanceof Phaser.Tilemaps.Tile ) {
        instance = instance.layer.tilemapLayer;
      }
      this.toucher = instance;
        if ((this.errorCheckNotNull( this.toucher, this.owner, "`Instance has Tag` block could not find an instance named [toucher].")).tags.has( 'obstaculo' )) {
        if ( 1 <= ( this.game.levelManager.levels.indexOf( this.scene ) + 1 ) && ( this.game.levelManager.levels.indexOf( this.scene ) + 1 ) <= this.game.levelManager.levels.length ) {
          this.game.levelManager.switchTo( ( this.game.levelManager.levels.indexOf( this.scene ) + 1 ) );
        } else {
          ( function() {
            var message = "`Go to level` block could not go to level number ( this.game.levelManager.levels.indexOf( this.scene ) + 1 ). Level numbers start at 1 and go up to the total number of levels in your game (" + this.game.levelManager.levels.length + ").";
            this.game.reportError( message, message, "SCRIPT ERROR" );
          } ).bind( this )();
        }
      }
      if ((this.errorCheckNotNull2( this.toucher, this.owner, "`Instance has Tag` block could not find an instance named [toucher].")).tags.has( 'llave' )) {
        if ( 1 <= ( this.game.levelManager.levels.indexOf( this.scene ) + 2 ) && ( this.game.levelManager.levels.indexOf( this.scene ) + 2 ) <= this.game.levelManager.levels.length ) {
          this.game.levelManager.switchTo( ( this.game.levelManager.levels.indexOf( this.scene ) + 2 ) );
        } else {
          ( function() {
            var message = "`Go to level` block could not go to level number ( this.game.levelManager.levels.indexOf( this.scene ) + 2 ). Level numbers start at 1 and go up to the total number of levels in your game (" + this.game.levelManager.levels.length + ").";
            this.game.reportError( message, message, "SCRIPT ERROR" );
          } ).bind( this )();
        }
      }

    }

  }
);

